webpackJsonp([8899970043806],{3775:function(a,t){a.exports={data:{markdownRemark:{html:'<p><a href="http://www16.big.or.jp/%7Ezun/html/game.html">東方Project</a>二次創作がメインの、たまーにオリジナル作品とかも作ったりする同人サークルであり、Webサイトでもあります。サイトの雰囲気が東方っぽくないように見えるかも知れませんが、気にしてはいけません。最近ちょっとだけVOCALOIDにも浮気気味。</p>\n<p>名前の由来は“<a href="http://www.ongaq.com/taq/">ongaq</a>”に対するリスペクトです。ドイツ語圏では『ク』を『q』と表記するそうで。特にdanmaqってスペル自体には意味はありません。トルコ系の言語で何らかの意味があるのかも。</p>\n<h2>サークルメンバー</h2>\n<p>サークル代表は<a href="?t=Manager">Mc(まく)</a>。常任メンバーは代表1人のみのソロサークルです。(原則、プロジェクトごとに臨時でサークルメンバーを募り、プロジェクト完了後解散する形をとっているので)</p>',frontmatter:{cover:null,date:"2004-12-28T00:00:59+09:00",strDate:"2004/12/27",title:"danmaqとは"}}},pathContext:{path:"/ja/blog/2004/12/28-danmaqとは/",langKey:"ja"}}}});
